func TestMinimeProof(t *testing.T) {
	app := TestBaseApplication(t)

	proofs := make([]ethstorageproof.StorageProof, len(minimeStorageProofs))
	for i, proofJSON := range minimeStorageProofs {
		if err := json.Unmarshal([]byte(proofJSON), &proofs[i]); err != nil {
			t.Fatal(err)
		}
	}

	pid := util.RandomBytes(types.ProcessIDsize)
	process := &models.Process{
		ProcessId:         pid,
		StartBlock:        0,
		EnvelopeType:      &models.EnvelopeType{EncryptedVotes: false},
		Mode:              new(models.ProcessMode),
		VoteOptions:       &models.ProcessVoteOptions{MaxCount: 1, MaxValue: 1, MaxVoteOverwrites: 0},
		Status:            models.ProcessStatus_READY,
		EntityId:          util.RandomBytes(types.EthereumAddressSize),
		CensusRoot:        testMinimeStorageRoot,
		CensusOrigin:      models.CensusOrigin_MINI_ME,
		BlockCount:        1024,
		MaxCensusSize:     1000,
		EthIndexSlot:      &testMinimeIndexSlot,
		SourceBlockHeight: &testMinimeSourceBlockHeight,
	}
	t.Logf("adding process %x", process.ProcessId)
	if err := app.State.AddProcess(process); err != nil {
		t.Fatal(err)
	}

	vp, err := state.NewVotePackage([]int{1, 2, 3, 4}).Encode()
	if err != nil {
		t.Fatal(err)
	}

	testHolders := make([]common.Address, len(testHoldersHex))
	for i, addrHex := range testHoldersHex {
		testHolders[i] = common.HexToAddress(addrHex)
	}

	// Test wrong vote (change value)
	var wrongProof ethstorageproof.StorageProof
	if err := json.Unmarshal([]byte(minimeStorageProofs[0]), &wrongProof); err != nil {
		t.Fatal(err)
	}
	wrongProof.StorageProof[0].Value = testutil.Hex2byte(nil, "020000000000000000000000000088c4dd")
	testMinimeSendVotes(t, wrongProof, testHolders[0], pid, vp, app, false)

	// Test valid votes
	for i, proof := range proofs {
		testMinimeSendVotes(t, proof, testHolders[i], pid, vp, app, true)
	}

	// Test double vote
	testMinimeSendVotes(t, proofs[2], testHolders[2], pid, vp, app, false)
}

func storageProofToModel(s *ethstorageproof.StorageResult) *models.ProofEthereumStorage {
	return &models.ProofEthereumStorage{
		Key:      s.Key,
		Value:    s.Value,
		Siblings: s.Proof,
	}
}

func testMinimeSendVotes(t *testing.T, s ethstorageproof.StorageProof, addr common.Address,
	pid []byte, vp []byte, app *BaseApplication, expectedResult bool) {
	cktx := new(abcitypes.CheckTxRequest)
	var cktxresp *abcitypes.CheckTxResponse
	var stx models.SignedTx

	t.Logf("voting %x", s.StorageProof[0].Key)
	proof := models.ProofMinime{
		ProofPrevBlock: storageProofToModel(&s.StorageProof[0]),
		ProofNextBlock: storageProofToModel(&s.StorageProof[1]),
	}
	tx := &models.VoteEnvelope{
		Nonce:       util.RandomBytes(32),
		ProcessId:   pid,
		Proof:       &models.Proof{Payload: &models.Proof_MinimeStorage{MinimeStorage: &proof}},
		VotePackage: vp,
	}

	signer := &ethereum.SignKeys{}
	found := false
	for _, key := range testHoldersSkHex {
		sk := ethereum.NewSignKeys()
		if err := sk.AddHexKey(key); err != nil {
			t.Fatal(err)
		}
		if sk.Address() == addr {
			signer = sk
			found = true
			break
		}
	}
	if !found {
		t.Fatalf("signer for address %s not found", addr)
	}
	pub, _ := signer.HexString()
	t.Logf("addr: %s pubKey: %s", signer.Address(), pub)

	var err error
	if stx.Tx, err = proto.Marshal(&models.Tx{Payload: &models.Tx_Vote{Vote: tx}}); err != nil {
		t.Fatal(err)
	}

	if stx.Signature, err = signer.SignVocdoniTx(stx.Tx, app.chainID); err != nil {
		t.Fatal(err)
	}

	if cktx.Tx, err = proto.Marshal(&stx); err != nil {
		t.Fatal(err)
	}
	cktxresp, _ = app.CheckTx(context.Background(), cktx)
	if cktxresp.Code != 0 {
		if expectedResult {
			t.Fatalf(fmt.Sprintf("checkTx failed: %s", cktxresp.Data))
		}
	} else {
		if !expectedResult {
			t.Fatalf("checkTx success, but expected result is fail")
		}
	}
	var txb []byte
	if txb, err = proto.Marshal(&stx); err != nil {
		t.Fatal(err)
	}
	detxresp := app.deliverTx(txb)
	if detxresp.Code != 0 {
		if expectedResult {
			t.Fatalf(fmt.Sprintf("deliverTx failed: %s", detxresp.Data))
		}
	} else {
		if !expectedResult {
			t.Fatalf("deliverTx uccess, but expected result is fail")
		}
	}
	_, err = app.CommitState()
	if err != nil {
		t.Fatal(err)
	}
}

